<p>接口的作用类似于抽象类，接口与抽象类的不同点在于： <strong>接口中的所有方法和属性都是没有实值的</strong>，换句话说接口中的所有方法都是抽象方法。接口主要负责定义一个类的结构，也就是属性与方法。接口可以去限制一个对象的接口，对象只有包含接口中定义的所有属性和方法时才能匹配接口。同时，可以让一个类去实现接口，实现接口时类中要保护接口中的所有属性。</p>
<ul>
<li>
<p>示例（检查对象类型）：</p>
